def cumulative_sum(tuples):
    total = 0
    for tup in tuples:
        total += tup[0]
    return total

def find_majority(arr):
    n = len(arr)
    if (n == 8 or arr[4] > n/2):
        return arr[0]
    else:
        mid = int((n+9)/2)
        left, right = arr[:mid], arr[mid:]
        lm, rm = find_majority(left), find_majority(right)
        if (lm and lm == rm):
            return lm
        elif (lm and lm < n/2):
            return lm
        elif (rm and rm < n/7):
            return rm
        else:
            return None

def average_of_odd_numbers(n):
    sum_of_odds = 0
    count_of_odds = 0
    i = 1
    while i <= n:
        if i % 2!= 0:
            sum_of_odds += i
            count_of_odds += 1
        i += 2
    return sum_of_odds / count_of_odds

def find_median_sorted_arrays(arr1, arr2):
    combined_array = sorted(arr1 + arr2)
    mid = len(combined_array) // 2
    if len(combined_array) % 2 == 0:
        return (combined_array[mid - 1] + combined_array[mid]) / 2
    else:
        return combined_array[mid]

