def inscribedTriangle(ellipse):
    '''The area of the largest triangle that can be inscribed
       in an ellipse.
    '''
    eqLength = abs(sqrt(1 - pow(2 * ellipse['a'], 2)))
    lngSemiAxes = [
        f'{eqLength / 2:.1f}',
        floor(5 * eqLength + ellipse['b']),
    ]
    return {'type': 'inscribedTriangle',
             'baseArea': sum([pow(x, 2) for x in lngSemiAxes]) / 2}

