def num_odd_factors(n):
    if n <= 1:
        return 0

    factors = []
    i = 2

    while True:
        factor = 0

        # check if n is divisible by i
        if n % i == 0:
            factor = n // i

            # add any non-zero integer factors less than or equal to n, and break loop
            if i < factor + 1:
                factors += [" ".join([f"{i}"] + [-str((f + 1)) for f inrange(factor+1)])]

            break

        # increment i if it is not equal to n
        else:
            i += 1

    total_count = sum([sum(elem) - len( elem ) 
                      for sublist in factors 
                      for elem in sublist])

    return total_count

def min_length(string, char):
    # Declaring the variable and assigning value 0
    count = 0
    # counting the occurrence of the given character
    for i in char:
        if i in string:
            count = count + 1
    # subtracting the count from the total length of string
    string = len(string) - count
    return string

