def check_reciprocal_roots(a, b, c):
    discriminant = b**2 - 4*a*c
    if discriminant < 0:
        return False
    root1 = (-b + math.sqrt(discriminant)) / (2*a)
    root2 = (-b - math.sqrt(discriminant)) / (2*a)
    if root1 == 1/root2:
        return True
    else:
        return False

