def heapify(arr):
    n = len(arr)
    for i in range(n//2, n):
        heapify_down(arr, i)
    return arr

def heapify_down(arr, i):
    largest = i
    left = 2 * i + 1
    right = 2 * i + 2
    if left < len(arr) and arr[left] > arr[largest]:
        largest = left
    if right < len(arr) and arr[right] > arr[largest]:
        largest = right
    if largest != i:
        arr[i], arr[largest] = arr[largest], arr[i]
        heapify_down(arr, largest)

