def max_frequency(lst):
    # Create a dictionary to store the frequency of each item in the list
    freq = {}
    for item in lst:
        if item in freq:
            freq[item] += 1
        else:
            freq[item] = 1

    # Find the item with maximum frequency
    max_count = 0
    max_item = None
    for item, count in freq.items():
        if count > max_count:
            max_count = count
            max_item = item

    return max_item

