from typing import List


class Solution:
    def minCostMatrix(self, cost: List[List[int]]) -> int:
        """
        Returns the minimal cost matrix found in cost[m][n].
        """
        m = len(cost)
        n = len(cost[0])
        grid = [[[cost[0][0] for _ in range(n)] for _ in range(m)] for _ in range(n)]

        # The previous matrix is updated using the previous matrix
        # where the current row is used with the previous colum
        for i in range(4):
            for j in range(m):
                for k in range(n):
                    if i == 0:
                        grid[k][j] = [cost[j][k] + grid[k][j - 1] for _ in range(m)]
                    elif i == 1:
                        grid[m - 1 - j][k] = [cost[m - 1 - j][k] + grid[m - 2][k][m - 1 - j] for _ in range(n)]
                    elif i == 2:
                        for jj in range(m):
                            grid[j][k] = grid[jj - 1][k]
                        for kk in reversed(range(n)):
                            grid[k][n - 1 - kk] = grid[k][kk]
                    elif i == 3:
                        grid[m - 1][k] = [cost[m - 1][k] + grid[m - 1 - j][k] for _ in range(m)]

        # Find the minimum cost from (0, 0) to (m, n), and return it.
        return min(
            grid[n - 1][m - 1]
        )

def max_sum_digits(n):
    """
    Given a number n, return a pair of numbers (x, y) such that x + Y = n and the sum of the digits Of x and y is maximum.
    """
    if n < 10:
        return (n, 0)
    x, y = 0, n
    while x < y:
        x, y = max(x, y), min(x, y)
    return (x, y)

